Mongodb aggregate pipeline to return multiple fields with $lookup from array<p>I'm trying to get a list of sorted comments by createdAt from a Post doc where an aggregate pipeline would be used to populate the owner of a comment in comments field with displayName and profilePhoto fields.</p>

<p>Post Schema: </p>

<pre><code>{
  _owner: { type: Schema.Types.ObjectId, ref: 'User', required: true },
  ...
  comments: [
    {
      _owner: { type: Schema.Types.ObjectId, ref: 'User' },
      createdAt: Number,
      body: { type: String, maxlength: 200 }
    }
  ]
}
</code></pre>

<p>User schema:</p>

<pre><code>{
  _id: '123abc'
  profilePhoto: String,
  displayName: String,
  ...
 }
</code></pre>

<p>What I want to return:</p>

<pre><code>[
  {
    "_id": "5bb5e99e040bf10b884b9653",
    "_owner": {
        "_id": "5bb51a97fb250722d4f5d5e1",
        "profilePhoto": "https://...",
        "displayName": "displayname"
    },
    "createdAt": 1538648478544,
    "body": "Another comment"
  },
  {
    "_id": "5bb5e96686f1973274c03880",
    "_owner": {
        "_id": "5bb51a97fb250722d4f5d5e1",
        "profilePhoto": "https://...",
        "displayName": "displayname"
    },
    "createdAt": 1538648422471,
    "body": "A new comment"
  }
]
</code></pre>

<p>I have some working code that goes from aggregate to get sorted comments first, then I populate separately but I want to be able to get this query just by using aggregate pipeline.</p>

<p>Current solution looks like this:</p>

<pre><code>  const postComments = await Post.aggregate([
    { $match: { _id: mongoose.Types.ObjectId(postId) } },
    { $unwind: '$comments' },
    { $limit: 50 },
    { $skip: 50 * page },
    { $sort: { 'comments.createdAt': -1 } },
    {$replaceRoot: {newRoot: '$comments'}},
    {
      $project: {
        _owner: 1,
        createdAt: 1,
        body: 1
      }
    }
  ]);

  await Post.populate(postComments, {path: 'comments._owner', select: 'profilePhoto displayName' } )
</code></pre>

